 import style from './Card.module.css'
 import { Link } from 'react-router-dom';



 const Card = ({id, name, status, species, gender, origin, image, onClose}) => {
  
   return (
      <div className={style.card}>
         
        <button onClick={()=> {onClose(id)}}>Close</button>
        <Link to={`/detail/${id}`}>
        <img src={image} alt="" />  
        <p>Name: "{name}"</p>
        <p>Status: "{status}"</p>
        <p>Species: "{species}"</p>
        <p>Gender: "{gender}"</p>
        <p>Origin: "{origin}"</p> 
         </Link>
           
      
      </div>
   );
};

export default Card
